### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Functional Dependencies and Normalization**
   - **Functional Dependencies (FDs):** Relationships between attributes in a database.
   - **Normalization:** Process of organizing data to minimize redundancy.
   - **Normal Forms:** 1NF, 2NF, 3NF, BCNF, 4NF.
   - **Boyce-Codd Normal Form (BCNF):** A higher level of normalization where every determinant is a candidate key.
   - **Fourth Normal Form (4NF):** Deals with multi-valued dependencies.

2. **Decomposition and Dependency Preservation**
   - **Lossless Decomposition:** Ensures that the original relation can be reconstructed from the decomposed relations.
   - **Dependency Preservation:** Ensures that all functional dependencies are maintained in the decomposed relations.

3. **Armstrong's Axioms**
   - **Reflexivity:** If \( Y \subseteq X \), then \( X \rightarrow Y \).
   - **Augmentation:** If \( X \rightarrow Y \), then \( XZ \rightarrow YZ \).
   - **Transitivity:** If \( X \rightarrow Y \) and \( Y \rightarrow Z \), then \( X \rightarrow Z \).

4. **SQL Injection**
   - **SQL Injection:** A code injection technique that exploits vulnerabilities in the database layer.
   - **Examples:** Basic SQL Injection, Union-Based SQL Injection, Error-Based SQL Injection, Blind SQL Injection, Time-Based Blind SQL Injection.

5. **Disk Storage and Performance**
   - **Disk Capacity:** Calculated based on the number of platters, surfaces, tracks, sectors, and bytes per sector.
   - **Rotational Latency:** Time taken for the disk to rotate to the desired sector.

#### Important Equations

1. **Disk Capacity Calculation**
   \[
   \text{Total Capacity} = \text{Number of Platters} \times \text{Surfaces per Platter} \times \text{Tracks per Surface} \times \text{Sectors per Track} \times \text{Bytes per Sector}
   \]
   \[
   \text{Total Capacity (GB)} = \frac{\text{Total Capacity (Bytes)}}{1,073,741,824}
   \]

2. **Rotational Latency Calculation**
   \[
   \text{Rotational Latency} = \frac{1}{\text{Revolutions per Second}} \times \frac{1000}{2}
   \]
   \[
   \text{Revolutions per Second} = \frac{\text{Revolutions per Minute}}{60}
   \]

3. **Armstrong's Axioms for Functional Dependencies**
   - **Reflexivity:** \( Y \subseteq X \Rightarrow X \rightarrow Y \)
   - **Augmentation:** \( X \rightarrow Y \Rightarrow XZ \rightarrow YZ \)
   - **Transitivity:** \( X \rightarrow Y \text{ and } Y \rightarrow Z \Rightarrow X \rightarrow Z \)

